import p5 from 'p5'

const sketch = (p: p5) => {
  p.setup = () => {
    p.frameRate(10)
    p.angleMode('degrees')
    const canvas = p.createCanvas(p.windowWidth, p.windowHeight)
    canvas.id("canvas")
  }

  p.draw = () => {
    p.background(255)
    p.noFill()

    oosenchi_v10(p)
  }
}

const oosenchi_v10 = (p: p5) => {
  const [startX, startY] = [100, 100]

  const num = 5
  const lineHeight = 500
  const [startControllX, startControllY] = [-35, 390]
  const [endControllX, endControllY] = [26, 485]
  const [endAnchorX, endAnchorY] = [32, lineHeight]
  const lineDistance = 50
  const bezierDistance = 25
  p.push()
  for (let i = 0; i < num * 2; i++) {
    if (i % 2 === 0) {
      p.translate(lineDistance, 0)
      p.line(startX, startY, startX, startY + lineHeight)
    } else {
      p.translate(bezierDistance, 0)
      p.bezier(startX, startY, startX + startControllX, startY + startControllY, startX + endControllX, startY + endControllY, startX + endAnchorX, startY + endAnchorY)
    }
  }
  p.pop()

  p.push()
  p.translate(lineDistance - bezierDistance - 10, 0)
  p.line(startX, startY, startX, startY + lineHeight)
  p.pop()

  p.push()
  p.translate((lineDistance + bezierDistance) * num + lineDistance, 0)
  p.line(startX + 10, startY, startX + 10, startY + lineHeight)
  p.line(startX + 30, startY, startX + 30, startY + lineHeight)
  p.pop()

  p.push()
  p.translate(lineDistance, 0)
  const triangleEndX = (bezierDistance + lineDistance) * num + startX + 31
  const triangleHeight = 60
  p.noStroke()
  p.fill(255)
  p.triangle(startX, startY + lineHeight + 1, triangleEndX, startY + endAnchorY - triangleHeight, triangleEndX, startY + endAnchorY + 1)
  p.pop()
}

const oosenchi_v9 = (p: p5) => {
  const centerX = p.windowWidth - 100
  const centerY = p.windowHeight - 100

  const num = 10
  const angle = 2.5
  const distanceFromCenter = 100

  const lengthIncrement = 10
  const endAnchorIncrement = 10
  const endControllIncrement = 15

  for (let i = 0; i < num * 2; i++) {
    const startAnchorX = 0
    const startAnchorY = -distanceFromCenter
    const endAnchorX = startAnchorX + 40 - (endAnchorIncrement * i)
    const endAnchorY = startAnchorY - 400 - (lengthIncrement * i)

    const startControllX = startAnchorX + 40
    const startControllY = startAnchorY - 60
    const endControllX = endAnchorX + 20 + (endControllIncrement * i)
    const endControllY = endAnchorY + 150 + (endControllIncrement / 3 * i)

    p.push()
    p.translate(centerX, centerY)
    p.circle(0, 0, 5)
    if (i % 2 === 0) {
      p.rotate(-angle * i * 1.5)
    } else {
      p.rotate(-angle * ((i + 1) * 1.5 - 1))
    }
    p.bezier(startAnchorX, startAnchorY, startControllX, startControllY, endControllX, endControllY, endAnchorX, endAnchorY)
    p.pop()
  }
}

